import React from "react";
import Cards from "./Cards";
import contacts from "../contacts.js";


function App() {
  return (
    <div>
      <Cards name={contacts[0].name} src={contacts[0].imgURL} phon={contacts[0].tel} email={contacts[0].email}/>
    </div>
  );
}

export default App;
